import{_ as t,j as n,o as a,v as c}from"./chunks/framework.OuVixYWh.js";const i=JSON.parse('{"title":"Sự khác biệt giữa import wildcard và import một class trong java","description":"Nên ưu tiên sử dụng **Import class**, **Import class** sẽ giúp người đọc file code dễ hiểu các import chúng ta đã sử dụng, làm gì và tránh các lỗi xung đột.","frontmatter":{"footer":true,"title":"Sự khác biệt giữa import wildcard và import một class trong java","description":"Nên ưu tiên sử dụng **Import class**, **Import class** sẽ giúp người đọc file code dễ hiểu các import chúng ta đã sử dụng, làm gì và tránh các lỗi xung đột.","authors":["lethanh"],"date":"2024-01-16T00:00:00.000Z","image":"https://static-cdn.thanhlv.com/blog/images/2024-01-16-su-khac-biet-giua-import-wildcard-va-import-mot-class-trong-java/image4.png","outline":"deep"},"headers":[{"level":2,"title":"Import wildcard(One for all package)","slug":"import-wildcard-one-for-all-package","link":"#import-wildcard-one-for-all-package","children":[]},{"level":2,"title":"One For One ( import trực tiếp một class )","slug":"one-for-one-import-truc-tiep-mot-class","link":"#one-for-one-import-truc-tiep-mot-class","children":[]},{"level":2,"title":"Ưu và nhược điểm của 2 loại import","slug":"uu-va-nhuoc-điem-cua-2-loai-import","link":"#uu-va-nhuoc-điem-cua-2-loai-import","children":[{"level":3,"title":"Performance ( Hiệu suất).","slug":"performance-hieu-suat","link":"#performance-hieu-suat","children":[]},{"level":3,"title":"Gọn code.","slug":"gon-code","link":"#gon-code","children":[]},{"level":3,"title":"Khả năng đọc hiểu ( clean code )","slug":"kha-nang-đoc-hieu-clean-code","link":"#kha-nang-đoc-hieu-clean-code","children":[]},{"level":3,"title":"Xung đột khi đặt tên","slug":"xung-đot-khi-đat-ten","link":"#xung-đot-khi-đat-ten","children":[]}]},{"level":2,"title":"Tổng kết","slug":"tong-ket","link":"#tong-ket","children":[]}],"relativePath":"blog/2024-01-16-su-khac-biet-giua-import-wildcard-va-import-mot-class-trong-java.md","filePath":"blog/2024-01-16-su-khac-biet-giua-import-wildcard-va-import-mot-class-trong-java.md","lastUpdated":1748188820000}'),o={name:"blog/2024-01-16-su-khac-biet-giua-import-wildcard-va-import-mot-class-trong-java.md"},r=[c('<h1 id="su-khac-biet-giua-import-wildcard-va-import-mot-class-trong-java" tabindex="-1">Sự khác biệt giữa import wildcard và import một class trong java <a class="header-anchor" href="#su-khac-biet-giua-import-wildcard-va-import-mot-class-trong-java" aria-label="Permalink to &quot;Sự khác biệt giữa import wildcard và import một class trong java&quot;">​</a></h1><p>Trong Java, khi chúng ta muốn sử dụng một class nào đó, thông thường sẽ sử dụng từ khóa <strong>import</strong>. <br> Các công cụ hỗ trợ như IDE thường cung cấp các cài đặt mặc định cho phong cách code khi sử dụng &quot;import&quot;. <br> Có hai cách phổ biến để sử dụng import: <strong>import wildcard</strong> và <strong>import trực tiếp một class</strong>.</p><p>Hãy cùng bắt đầu tìm hiểu sự khác biệt của hai cách đó nhé!</p><nav class="table-of-contents"><ul><li><a href="#import-wildcard-one-for-all-package">Import wildcard(One for all package)</a></li><li><a href="#one-for-one-import-truc-tiep-mot-class">One For One ( import trực tiếp một class )</a></li><li><a href="#uu-va-nhuoc-điem-cua-2-loai-import">Ưu và nhược điểm của 2 loại import</a><ul><li><a href="#performance-hieu-suat">Performance ( Hiệu suất).</a></li><li><a href="#gon-code">Gọn code.</a></li><li><a href="#kha-nang-đoc-hieu-clean-code">Khả năng đọc hiểu ( clean code )</a></li><li><a href="#xung-đot-khi-đat-ten">Xung đột khi đặt tên</a></li></ul></li><li><a href="#tong-ket">Tổng kết</a></li></ul></nav><h2 id="import-wildcard-one-for-all-package" tabindex="-1">Import wildcard(One for all package) <a class="header-anchor" href="#import-wildcard-one-for-all-package" aria-label="Permalink to &quot;Import wildcard(One for all package)&quot;">​</a></h2><p>Đúng như vậy, One for All chỉ cần import một lần, sau đó chúng ta có thể sử dụng tất cả các class trong package đó.</p><p>Dễ nhận diện nhất trong cách import wildcard là khi thấy ký hiệu <strong>*</strong> ở cuối import. Ký hiệu này đại diện cho tất cả các class trong package, không bao gồm các sub folder.</p><p><img src="https://static-cdn.thanhlv.com/blog/images/2024-01-16-su-khac-biet-giua-import-wildcard-va-import-mot-class-trong-java/image1.png" alt="Image"></p><p>Ví dụ, nếu bạn sử dụng List, ListResourceBundle, Locale, Random, LongSummaryStatistics, và Map, tất cả đều thuộc package java.util. <br> Chúng ta có thể sử dụng import cho cả package đó và chỉ cần thực hiện import một lần duy nhất trong class mà chúng ta sử dụng.</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>import java.util.*</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>Cách import này thường được gọi trong tài liệu là <strong>Import wildcard</strong></p><p><img src="https://static-cdn.thanhlv.com/blog/images/2024-01-16-su-khac-biet-giua-import-wildcard-va-import-mot-class-trong-java/image2.png" alt="Image"></p><p>Sử dụng import wildcard sẽ giúp ngắn gọn và tránh tình trạng import dài và khó nhìn trên một class. <br> Lưu ý: Khi sử dụng import package, chỉ các class trong package đó mới có thể được import. Các sub package sẽ không được import.</p><h2 id="one-for-one-import-truc-tiep-mot-class" tabindex="-1">One For One ( import trực tiếp một class ) <a class="header-anchor" href="#one-for-one-import-truc-tiep-mot-class" aria-label="Permalink to &quot;One For One ( import trực tiếp một class )&quot;">​</a></h2><p><strong>Import Class</strong> là <strong>One For One</strong>, nghĩa là mỗi dòng import chỉ áp dụng cho một class. <br> Để import nhiều class từ bên ngoài và sử dụng chúng, chúng ta cần sử dụng nhiều dòng import để đưa từng class vào.</p><p>Các import sẽ cần được chỉ định rõ ràng để xác định class nào cần được sử dụng. <br> Kiểu Import trực tiếp một class thì dễ nhận biết nhất là không có ký hiệu * ở cuối. Chúng ta sẽ chỉ rõ trực tiếp đến class nào cần được import. <img src="https://static-cdn.thanhlv.com/blog/images/2024-01-16-su-khac-biet-giua-import-wildcard-va-import-mot-class-trong-java/image3.png" alt="Image"></p><p>Việc sử dụng import class giúp chúng ta dễ dàng nhận biết rằng chúng ta đang sử dụng những class nào từ bên ngoài để hỗ trợ cho class hiện tại của chúng ta. <br> Như trong ví dụ trên, ta có thể ngay lập tức nhận biết rằng đang sử dụng Operation và Parameter từ thư viện SpringFox mà không cần phải đọc mã nguồn ở dưới để xác định.</p><h2 id="uu-va-nhuoc-điem-cua-2-loai-import" tabindex="-1">Ưu và nhược điểm của 2 loại import <a class="header-anchor" href="#uu-va-nhuoc-điem-cua-2-loai-import" aria-label="Permalink to &quot;Ưu và nhược điểm của 2 loại import&quot;">​</a></h2><h3 id="performance-hieu-suat" tabindex="-1">Performance ( Hiệu suất). <a class="header-anchor" href="#performance-hieu-suat" aria-label="Permalink to &quot;Performance ( Hiệu suất).&quot;">​</a></h3><p><strong>Tại thời điểm Runtime</strong> thì import wildcard và import class sẽ không có sự khác biệt. Cả 2 vẫn sẽ có tốc độ giống nhau, tuy nhiên tại thời điểm compiler thì sẽ có sự khác nhau.</p><p><strong>Import wildcard</strong>: Tại thời điểm compiler, java compiler sẽ tiến hành phân tích code để tìm kiếm các class sử dụng và thay thế import wildcard bằng import class.</p><p><strong>Import Class</strong> : Tại thời điểm compiler, java compiler sẽ không cần phân tích như trường hợp ở Import wildcard.</p><p><strong>Kết quả Performance:</strong> Bởi vì Import wildcard yêu cầu phải phân tích mã nguồn của chúng ta để xác định những class chúng ta đang sử dụng trong các Import wildcard, nó có thể gây một chút độ trễ so với Import Class.</p><p>Tuy nhiên với các dự án nhỏ sẽ không quá ảnh hưởng vì nó sẽ chậm hơn không đáng kể. Nhưng với các dự án có lượng code lớn lên tới hàng triệu line code thì sẽ có sự ảnh hưởng lớn.</p><h3 id="gon-code" tabindex="-1">Gọn code. <a class="header-anchor" href="#gon-code" aria-label="Permalink to &quot;Gọn code.&quot;">​</a></h3><p><strong>Import wildcard</strong> sẽ dễ nhìn hơn, nếu chúng ta sử dụng nhiều class trong cùng 1 package ví dụ là 100 class thì với <strong>Import Class</strong> chúng ta sẽ mất 100 line code cho việc này. Với <strong>Import wildcard</strong> thì đơn giản hơn, chúng ta thì cần 1 import là xong.</p><p><strong>Import class</strong> nếu sử dụng nhiều class trong cùng 1 package và sử dụng rất nhiều thì sẽ gây nhiều dòng trong file code của chúng ta, no sẽ gấy dối và khó chịu.</p><p><strong>Kết quả gọn code:</strong> <strong>Import wildcard</strong> sẽ gọn code hơn</p><h3 id="kha-nang-đoc-hieu-clean-code" tabindex="-1">Khả năng đọc hiểu ( clean code ) <a class="header-anchor" href="#kha-nang-đoc-hieu-clean-code" aria-label="Permalink to &quot;Khả năng đọc hiểu ( clean code )&quot;">​</a></h3><p><strong>Import wildcard</strong> chúng ta sẽ khó biết class nào được được import, chúng ta chỉ biết rằng mình có sử dụng class trong package này, chúng ta cần đọc code logic để tìm ra chúng ta đang dùng các class nào.</p><p><strong>Import class</strong> đọc các line Import ở đầu class, chúng ta sẽ dễ ràng biết được rằng trong file code java này chúng ta đã sử dụng các class bên ngoài nào.</p><p><strong>Khả năng đọc hiểu:</strong> <strong>Import class</strong> sẽ dễ đọc hiểu hơn</p><h3 id="xung-đot-khi-đat-ten" tabindex="-1">Xung đột khi đặt tên <a class="header-anchor" href="#xung-đot-khi-đat-ten" aria-label="Permalink to &quot;Xung đột khi đặt tên&quot;">​</a></h3><p><strong>Import wildcard</strong> Khi chúng ta có 2 class cùng tên trong 2 package khác nhau, nếu chúng ta sử dụng <strong>Import wildcard</strong> cả 2 package thì compiler sẽ không biết tại thời điểm nào chúng ta sử dụng class nào. <br> Trong trường hợp này, tại thời điểm compiler java sẽ báo lỗi</p><p><strong>Import class</strong> với import class chúng ta có thể chỉ rõ class path sử dụng tại trong file code của chúng ta. <br> Vì vậy trong trường hợp 2 hoặc nhiều package có cùng tên class thì cũng không có vấn đề gì cả. <img src="https://static-cdn.thanhlv.com/blog/images/2024-01-16-su-khac-biet-giua-import-wildcard-va-import-mot-class-trong-java/image4.png" alt="Image"></p><h2 id="tong-ket" tabindex="-1">Tổng kết <a class="header-anchor" href="#tong-ket" aria-label="Permalink to &quot;Tổng kết&quot;">​</a></h2><p>Vậy là mình đã giải thích cho các bạn ý nghĩa của 2 cách import trong java, mỗi một loại import đều sẽ có ưu và nhược điểm riêng của nó.</p><p>Tuy nhiên sau nhiều năm kinh nghiệm của mình, mình nhận thấy rằng</p><div class="tip custom-block"><p class="custom-block-title">Gợi ý</p><p>Nên ưu tiên sử dụng <strong>Import class</strong>, <strong>Import class</strong> sẽ giúp người đọc file code dễ hiểu các import chúng ta đã sử dụng, làm gì và tránh các lỗi xung đột…</p></div>',39)];const s=t(o,[["render",function(t,c,i,o,s,g){return a(),n("div",null,r)}]]);export{i as __pageData,s as default};
